import React from 'react';
import 'react-native-gesture-handler';
import { StyleSheet, Text, View } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';

import LoginScreen from './Screens/LoginScreen'
import RegisterScreen from './Screens/RegisterScreen';
import HomeScreen from './Screens/HomeScreen'
import DirectionScreen from './Screens/DirectionScreen';
import ParkedScreen from './Screens/ParkedScreen';
import ExitingScreen from './Screens/ExitingScreen';

import { database } from './firebase'
import {Print} from 'expo';

const Stack = createStackNavigator(); 
const globalScreenOptions = {
  headerStyle: {backgroundColor: "#2C6BED"},
  headerTitleScreen: {color: "white"},
  headerTintColor: "white"
}
var carstatus = 'idle'
function getStatus() {
  database.ref("Users/username1").on('value', function(snapshot) {
    carstatus = snapshot.val().carstatus
    return carstatus
  });
}
getStatus()
console.log("hello")
export default function App() {
  return (
    <NavigationContainer>
      <Stack.Navigator screenOptions={globalScreenOptions} >
        <Stack.Screen name="Login" component={LoginScreen} getStatus/>
        <Stack.Screen name='Register' component={RegisterScreen} />
        <Stack.Screen name='Home' component={HomeScreen} />
        <Stack.Screen name='Parking Directions' component={DirectionScreen} />
        <Stack.Screen name='Parked' component={ParkedScreen} />
        <Stack.Screen name='Exiting Directions' component={ExitingScreen} />
      </Stack.Navigator>
    </NavigationContainer>

  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
